import { withStyles } from '@material-ui/core/styles';

import Terms from './Terms'


const styles = (theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
  bbbb: {
    margin: '5rem',
  },
});

export default withStyles(styles)(Terms);
